function Table(props) {
  console.log(props.apiData);

  if (!props.apiData.results) {
    // If the API request isn't completed return "loading...""
    return <p>Loading...</p>;
  } else {

    // Extract the data from the API response
    const data = props.apiData.results;

    // Create the table structure using JSX
    return (
      <table>
        <thead>
          <tr>
            {Object.keys(data[0]).map((key) => {
              if (key === 'ContinentCode' || key === 'CountryCode') {
                return null; // Skip these columns
              }
              return <th key={key}>{key}</th>;
            })}
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              {Object.keys(row).map((key) => {
                if (key === 'ContinentCode' || key === 'CountryCode') {
                  return null; // Skip these columns
                }
                return <td key={key}>{row[key]}</td>;
              })}
            </tr>
          ))}
        </tbody>
      </table>
    );
  }
}

export default Table;
